           margin: 10px 45px 30px 45px;
       }

    </style>
</head>
<body>

<div class="one">
       Application ID :  {{data1?.applicationId}}<br/>
       Application Status : {{data1?.applicationStatus}}<br/>
       Score : {{data1?.score}}<br/>
       Decline Reason : {{data1?.declineReason}}<br/>          
</div>
<br/>
<h3>Original Application</h3>
<hr height="2px">
<br/>
<div >
   <form class="two" >
       <label> First Name </label>
             <input type="text" value="{{customerData1?.firstName}}" readonly>
        <span style="margin-left:85px">Address</span>
        <span class="demo1">
            <label>Address Line 1 </label>
             <input type="text" value="{{customerData1?.address.addressline1}}" readonly>
           <br/>
           <label>Address Line 2 </label>
             <input type="text" value="{{customerData1?.address.addressline2}}" readonly>
           <br/>
           <label>City </label>
             <input type="text" value="{{customerData1?.address.city}}" readonly>
           <br/>
           <label>State </label>
             <input type="text" value="{{customerData1?.address.state}}" readonly>
           <br/>
           <label>Postal Code </label>
             <input type="text" value="{{customerData1?.address.postalCode}}" readonly>
        </span> 
        <br/> <br/>
         <label>Middle Name </label>  
             <input type="text" value="{{customerData1?.middleName}}" readonly>
        <br/><br/>
       <label>Last Name </label>
             <input type="text" value="{{customerData1?.lastName}}" readonly>  
       <br/><br/>    
         <label>Date of Birth </label>  
             <input type="date" value="{{customerData1?.dateOfBirth}}" readonly >
        <br/><br/> 
        <label>Marital Status </label>
             <input type="text" value="{{customerData1?.maritalStatus}}" readonly>
        <span style="margin-left:380px">Contact Information</span>  
        <span class="demo2">
            <label>Home Phone  </label>
             <input type="text" value="{{customerData1?.homePhone}}" readonly>
           <br/>
           <label>Office Phone </label>
             <input type="text" value="{{customerData1?.officePhone}}" readonly>
           <br/>
           <label>Mobile </label>
             <input type="text" value="{{customerData1?.mobile}}" readonly>
           <br/>
           <label>Email Address</label>
             <input type="text" value="{{customerData1?.emailAddress}}" readonly>
        </span> 
        <br/> 
        <label>SSN Number </label>  
             <input type="text" value="{{customerData1?.ssnNumber}}" readonly>
        <br/><br/>
       <label>Loan Amount </label>
